import * as React from "react";
import {Box, Grid, Typography } from "@mui/material";

function About() {
  return (
    <>
      <Box
        sx={{
          backgroundColor: "#ab47bc",
          width: "100%",
          height: "350px",
          display: "flex",
          justifyContent: "center",
        }}
      >
        <Grid item xs={12} sm={12} md={12}>
          <Typography variant="h4" textAlign="center">
            Product
          </Typography>
        </Grid>
      </Box>
    </>
  );
}
export default About;
